import { withRouter } from 'react-router-dom'
import BackBlogGround from './BackBlogGround'

/**
 * 我们的留言的审核
 */
class CommonSiteManage extends React.Component{

    render (){

        return(
            <BackBlogGround
            leftSpan={0}
            rightSpan={24}
            extra={
                <Row gutter={[16,16]}>
                    <Col span={24}>
                        <Card 
                        title={"博主文章"}
                        extra={
                            <div>您的位置：博主文章</div>
                        }
                        >
                            <BackBlogTopic/>
                        </Card>
                    </Col>
                </Row>
            }
            />
        )
    }

}

export default withRouter(CommonSiteManage)
